//Try to setup first connection only to select the correct icon
window.socket = new WebSocket("ws://127.0.0.1:9000");
msg = JSON.stringify({"id": "to_arduino_gateway"});

//Variable to inform if this is the first connection
let first_con = true

//Variable to check if connection is active
let socket_open = false
let auto_connect = false // option to automatic connection when websocket is available

function connection() {
	if (window.socket == null && auto_connect == true){
		button = document.getElementById(Icon_ID);
		button.src = DisconnectedIcon;		
		console.log('window.socket = null');
		window.socket = new WebSocket("ws://127.0.0.1:9000");
		msg = JSON.stringify({"id": "to_arduino_gateway"});
		window.socket.send(msg);		
		// auto_connect = false;
		sleep(3000)
	}
	if (window.socket.readyState == 0) {
		button = document.getElementById(Icon_ID);
		button.src = ConnectingIco;
		console.log('Socket is Connecting: ' + window.socket.readyState );
	
	}
	if (window.socket.readyState == 1 && socket_open == false) {
		button = document.getElementById(Icon_ID);
		button.src = ConnectedIcon;
		console.log('Socket is Conected: ' + window.socket.readyState );

	}
	if (window.socket.readyState == 2) {
		button = document.getElementById(Icon_ID);
		button.src = ClosingIcon;
		console.log('Socket is Closing: ' + window.socket.readyState );

	}	
	if (window.socket.readyState == 3) {
		console.log('Socket is Closed: ' + window.socket.readyState);
		button = document.getElementById(Icon_ID);
		button.src = DisconnectedIcon;
		window.socket = null
	}
};

function sleep(milliseconds) {
  var start = new Date().getTime();
  for (var i = 0; i < 1e7; i++) {
	if ((new Date().getTime() - start) > milliseconds){
	  break;
	}
  }
}

function stopsearch () {
	if (window.socket == null || window.socket.readyState == 3) {
		auto_connect = !auto_connect
	}
}


